anonDescPortal:"Permitir ${startSpan}acesso an\u00f3nimo${endSpan} ao seu ${type}.",anonDescDoc:"O que \u00e9 que isto significa?",anonTooltip:"Os utilizadores an\u00f3nimos poder\u00e3o apenas visualizar, aceder ou pesquisar recursos da organiza\u00e7\u00e3o que s\u00e3o partilhados para o p\u00fablico. Se ativar o acesso an\u00f3nimo, certifique-se que os grupos selecionados para Mapas em Destaque, Galeria, Galeria de Mapas Base e Modelos de Aplica\u00e7\u00f5es Web estejam partilhados para o p\u00fablico; Caso contr\u00e1rio, os utilizadores an\u00f3nimos poder\u00e3o n\u00e3o ser capazes de visualizar ou aceder ao conte\u00fado p\u00fablico destes grupos corretamente.",
