securityChanged:"A desativa\u00e7\u00e3o do SSL exige que inicie sess\u00e3o novamente.",enterpriseLoginsSetting:"In\u00edcios de Sess\u00e3o Empresariais",enterpriseLoginsPortalSetting:"In\u00edcios de Sess\u00e3o Empresariais via SAML",enterpriseLoginsDesc:"Pode configurar a sua Organiza\u00e7\u00e3o de modo a permitir aos utilizadores iniciarem sess\u00e3o no ArcGIS com o mesmo nome de utilizador e a mesma palavra-passe que utilizam com os sistemas existentes nas instala\u00e7\u00f5es.",enterpriseLoginsPortalDesc:"Pode configurar o seu portal de modo a permitir aos utilizadores iniciarem sess\u00e3o no Portal for ArcGIS com o mesmo nome de utilizador e a mesma palavra-passe que utilizam com os sistemas existentes nas instala\u00e7\u00f5es.",
identityFederationDesc:"${tooltipStart}A chave deste processo \u00e9 uma tecnologia conhecida como federa\u00e7\u00e3o de identidade, que poder\u00e1 configurar com a ajuda desta sec\u00e7\u00e3o atrav\u00e9s de duas a\u00e7\u00f5es${tooltipEnd}.",setIdentityProvider:"Definir Fornecedor de Identidade",editIdentityProvider:"Editar Fornecedor de Identidade",removeIdentityProvider:"Remover Fornecedor de Identidade",getServiceProvider:"Obter Fornecedor de Servi\u00e7os",removingIdentityProvider:"Est\u00e1 prestes a remover o seu fornecedor de identidade empresarial configurado. Os membros cujas contas recorram a esse fornecedor de identidade deixar\u00e3o de poder iniciar sess\u00e3o se avan\u00e7ar para a remo\u00e7\u00e3o do fornecedor.",
doRemoveIdentityProvider:"Deseja remover o seu fornecedor de identidade empresarial configurado?",couldNotRemoveIdentityProvider:"Ocorreu um problema ao remover o fornecedor de identidade empresarial configurado.",aboutIdentityFederation:"A federa\u00e7\u00e3o de identidade \u00e9 possibilitada pelo estabelecimento de uma rela\u00e7\u00e3o de confian\u00e7a entre o seu fornecedor de identidade empresarial e o ArcGIS Online na fun\u00e7\u00e3o de fornecedor de servi\u00e7os. Os dois fornecedores trocam informa\u00e7\u00f5es atrav\u00e9s de um protocolo baseado em web conhecido como SAML2.",
aboutIdentityFederationPortal:"A federa\u00e7\u00e3o de identidade \u00e9 possibilitada pelo estabelecimento de uma rela\u00e7\u00e3o de confian\u00e7a entre o seu fornecedor de identidade empresarial e o Portal for ArcGIS na fun\u00e7\u00e3o de fornecedor de servi\u00e7os. Os dois fornecedores trocam informa\u00e7\u00f5es atrav\u00e9s de um protocolo baseado em web conhecido como SAML2.",onceFederated:"Depois de configurar a federa\u00e7\u00e3o, os membros ser\u00e3o redirecionados automaticamente para os servidores web que fazem parte da sua empresa e que permitem aos utilizadores iniciarem sess\u00e3o na empresa. Os resultados desse in\u00edcio de sess\u00e3o s\u00e3o comunicados ao ArcGIS Online, que permite aos utilizadores trabalharem com os seus conte\u00fados no ArcGIS Online.",
onceFederatedPortal:"Depois de configurar a federa\u00e7\u00e3o, os seus membros ser\u00e3o redirecionados automaticamente para os servidores web que fazem parte da sua empresa e que permitem aos utilizadores iniciarem sess\u00e3o na empresa. Os resultados desse in\u00edcio de sess\u00e3o s\u00e3o comunicados ao Portal for ArcGIS, que permite aos utilizadores trabalharem com os seus conte\u00fados no Portal for ArcGIS.",useSetIdentityProvider:"Utilize o bot\u00e3o Definir Fornecedor de Identidade para disponibilizar ao ArcGIS Online informa\u00e7\u00f5es relativas ao Fornecedor de Identidade Empresarial compat\u00edvel com SAML2.",
useSetIdentityProviderPortal:"Utilize o bot\u00e3o Definir Fornecedor de Identidade para disponibilizar ao Portal for ArcGIS informa\u00e7\u00f5es relativas ao Fornecedor de Identidade Empresarial compat\u00edvel com SAML2.",useGetServiceProvider:"Utilize o bot\u00e3o Obter Fornecedor de Servi\u00e7os para disponibilizar ao Fornecedor de Identidade Empresarial informa\u00e7\u00f5es relativas ao ArcGIS Online (o Fornecedor de Servi\u00e7os neste contexto).",useGetServiceProviderPortal:"Utilize o bot\u00e3o Obter Fornecedor de Servi\u00e7os para disponibilizar ao Fornecedor de Identidade Empresarial informa\u00e7\u00f5es relativas ao ArcGIS Online (o Fornecedor de Servi\u00e7os neste contexto).",
signInSetting:"Op\u00e7\u00f5es de Iniciar sess\u00e3o",signInDesc:"Personalizar a p\u00e1gina de in\u00edcio de sess\u00e3o de ${type} para que ${tooltipStart}os membros possam iniciar sess\u00e3o utilizando${tooltipEnd}:",signInTooltip:"Pode utilizar esta sec\u00e7\u00e3o para controlar as op\u00e7\u00f5es apresentadas na sua p\u00e1gina de in\u00edcio de sess\u00e3o. Se a maioria dos utilizadores iniciar sess\u00e3o utilizando o in\u00edcio de sess\u00e3o empresarial de ${name}, pode ativar apenas esta op\u00e7\u00e3o na sua p\u00e1gina de in\u00edcio de sess\u00e3o personalizada de ${type}. Os administradores que pretendam iniciar sess\u00e3o utilizando os seus in\u00edcios de sess\u00e3o ${arcgis} podem faz\u00ea-lo atrav\u00e9s da p\u00e1gina de in\u00edcio de sess\u00e3o padr\u00e3o de ${site}.",
arcgisSignIn:"In\u00edcio de sess\u00e3o ${name}",enterpriseSignIn:"In\u00edcio de sess\u00e3o ${name}",automaticRegistration:"Registo de conta autom\u00e1tico",selfSignUp:"\u00cdnicio de sess\u00e3o autom\u00e1tico",multiFactorAuth:"Autentica\u00e7\u00e3o Multi-Fator",multiFactorAuthDesc:"A autentica\u00e7\u00e3o Multi-fator oferece a todos os membros com contas ArcGIS na sua organiza\u00e7\u00e3o um n\u00edvel extra de seguran\u00e7a, ao pedir um c\u00f3digo de verifica\u00e7\u00e3o adicional no in\u00edcio de sess\u00e3o.",
